, 
[75415003] = {id = 75415003, remark = "ねぇ、あんたも暇ならさ。\nちょっと、行きたい場所あるから付き合ってよ。", type = 1, option_ids = "0", next = -1, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
