[75415004] = {id = 75415004, remark = "うん、人はいないね。\nやっぱり、ここは気持ちいいなぁ。", type = 1, option_ids = "0", next = 75415005, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", role_admission_type = "75200151:50:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75415005] = {id = 75415005, remark = "あんた、来たことある？\nここはねー、あたしの思い出の場所なの。", type = 1, option_ids = "0", next = 75415006, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75415006] = {id = 75415006, remark = "父さんと母さんはここで結婚を誓ったし、\nその間に生まれたあたしは昔、ここで遊んだし。", type = 1, option_ids = "0", next = 75415007, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75415007] = {id = 75415007, remark = "たーっくさん、仲間がいてさ…\n大変な中でも、みんな優しくて…", type = 1, option_ids = "0", next = 75415008, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75415008] = {id = 75415008, remark = "…ほんと遠くまで来ちゃったな、長く生きすぎたよ。\nそりゃ、みんないなくなるわけだ。", type = 1, option_ids = "75501501:75501502", next = 0, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75415009] = {id = 75415009, remark = "こら、できない約束はするもんじゃないよ。\n…ま、その心意気は買うけどさ。", type = 1, option_ids = "0", next = 75415011, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75415010] = {id = 75415010, remark = "…何その宣言。\n海でおぼれかけたりしたくせに。", type = 1, option_ids = "0", next = 75415011, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75415011] = {id = 75415011, remark = "でも死んで神様になれれば、ずっと一緒に\nいられるかもね。いっぺん死んでみる？", type = 1, option_ids = "0", next = 75415012, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75415012] = {id = 75415012, remark = "おすすめしないけどね。死ぬのって結構大変だし、\nそれにあんたが神様ってのも似合わなそうだし。", type = 1, option_ids = "0", next = 75415013, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75415013] = {id = 75415013, remark = "つまり、あんたは無力な人間でいいの。\nで、つまんない神様は、あたしだけでじゅうぶん。", type = 1, option_ids = "0", next = 75415014, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75415014] = {id = 75415014, remark = "…女神らしく、あんたがこの世界をどうするのか\n見ててあげるからさ。", type = 1, option_ids = "0", next = 75415015, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75415015] = {id = 75415015, remark = "あたしを飽きさせないでよ、リーダー。", type = 1, option_ids = "0", next = -1, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75415101] = {id = 75415101, remark = "はぁー…", type = 1, option_ids = "0", next = 75415102, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", role_admission_type = "75200151:50:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020009}
, 
[75415102] = {id = 75415102, remark = "あんたとまた会うなんて…じゃなかった。\nえーっと初めまして。", type = 1, option_ids = "0", next = 75415103, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020009}
, 
[75415103] = {id = 75415103, remark = "あたしは女神…じゃなくて、天の塔の管理人\nエヴァンテ、よろしくしなくていいからね。", type = 1, option_ids = "0", next = 75415104, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020009}
, 
[75415104] = {id = 75415104, remark = "はぁ、あほらしい…", type = 1, option_ids = "0", next = 75415105, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020009}
, 
[75415105] = {id = 75415105, remark = "ほんとあたし、なんでこんなところにいるんだか…\nいや、全知全能の神のせいだけど…", type = 1, option_ids = "0", next = 75415106, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020009}
, 
