[75415111] = {id = 75415111, remark = "…あのねぇ、女神は基本見守るキャラでしょ。\nここにいること自体おかしいの。わかる？", type = 1, option_ids = "0", next = 75415112, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020009}
, 
[75415112] = {id = 75415112, remark = "なんでそんな面倒なことしなきゃいけないの。\n絶対に嫌だから。ほら、早く帰って――", type = 1, option_ids = "0", next = 75415113, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020009}
, 
