[75415308] = {id = 75415308, remark = "そうそう、もうひとつ見せたいものがあるんだ。\nきっとあんたも喜ぶと思って。", type = 1, option_ids = "0", next = 75415309, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020009}
, 
[75415309] = {id = 75415309, remark = "じゃーん！　ほら、テレビとゲーム機！\n作るの苦労したんだから。", type = 1, option_ids = "0", next = 75415310, role_ids = "75200151", expression = "0", action = "0", action_type = "0", role_type = 75200151, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020009}
, 
